import React from 'react'
import classes from './HeaderCardButton.module.css'

function HeaderCardButton() {
    return (
        <div>
            <button className={classes.cardButton} onc>
                <span>Your Cart</span>
                <span>3</span>
            </button>
        </div>
    )
}

export default HeaderCardButton
